CREATE DEFINER=`jkc`@`%` PROCEDURE `f_handheld_tarif` (IN `metoda_tct` INT, IN `gol` INT, IN `addwhere` VARCHAR(300))  BEGIN



	DECLARE metoda int DEFAULT 0;



	SELECT



		tbl_handheld_metoda_bayar.handheld_id INTO metoda



	FROM tbl_handheld_metoda_bayar



	WHERE



		tbl_handheld_metoda_bayar.metoda_bayar_id=metoda_tct



	LIMIT 1;







	SET @nsql = CONCAT(



		'SELECT ((',



			metoda_tct,'*1000)+(A.`gerbang_id`*10)+',gol,') AS `IDTARIF`,',



			'A.`gerbang_id` AS `IDGERBANG`,',



			gol,' AS `IDGOLONGAN`,',



			metoda,' AS `IDMETODA`,',



			'(A.gol',gol,'+A.gol',gol,'_d) * ((100-IFNULL(B.diskon,0))/100) AS `RUPIAH`,',



			'NOW()- INTERVAL 1 DAY AS `REVISITARIF`,',



			'0 AS `IDASALGERBANG`,',



			'0 AS `AGS`,',



			'NOW()- INTERVAL 1 DAY AS `SOP`,',



			'NOW()- INTERVAL 1 DAY AS `DTIME`,',



			'0 AS `STATUS`',



		'FROM ',



		'tbl_tarif_open A ',



		'LEFT JOIN tbl_diskon B ON A.gerbang_id = B.gerbang_id AND B.aktif=1 AND B.metoda_bayar_id=',metoda_tct,



		' WHERE A.aktif=1',addwhere,



		' GROUP BY IDTARIF'



		);



	PREPARE stmt1 FROM @nsql;



	EXECUTE stmt1;



	DEALLOCATE PREPARE stmt1;



END$$

CREATE DEFINER=`jkc`@`%` PROCEDURE `f_handheld_tarif_exit` (IN `metoda_tct` INT, IN `gol` INT, IN `addwhere` VARCHAR(300))  BEGIN



	DECLARE metoda int DEFAULT 0;



	SELECT



		tbl_handheld_metoda_bayar.handheld_id INTO metoda



	FROM tbl_handheld_metoda_bayar



	WHERE



		tbl_handheld_metoda_bayar.metoda_bayar_id=metoda_tct



	LIMIT 1;







	SET @nsql = CONCAT(



		'SELECT ((',



			metoda_tct,'*1000)+(A.`gerbang_id`*10)+(A.asal_gerbang*100000)+',gol,') AS `IDTARIF`,',



			'A.`gerbang_id` AS `IDGERBANG`,',



			gol,' AS `IDGOLONGAN`,',



			metoda,' AS `IDMETODA`,',



			'(A.gol',gol,'+A.gol',gol,'_d)  * ((100-IFNULL(B.diskon,0))/100) AS `RUPIAH`,',



			'NOW()- INTERVAL 1 DAY AS `REVISITARIF`,',



			'A.asal_gerbang AS `IDASALGERBANG`,',



			'IF(A.asal_gerbang=20,1,0) AS `AGS`,',



			'NOW()- INTERVAL 1 DAY AS `SOP`,',



			'NOW()- INTERVAL 1 DAY AS `DTIME`,',



			'0 AS `STATUS`',



		'FROM ',



		'tbl_tarif_exit A ',



		'LEFT JOIN tbl_diskon B ON A.gerbang_id = B.gerbang_id AND B.aktif=1 AND B.metoda_bayar_id=',metoda_tct,



		' WHERE A.aktif=1',addwhere, 



		' GROUP BY IDTARIF'



		);



	PREPARE stmt1 FROM @nsql;



	EXECUTE stmt1;



	DEALLOCATE PREPARE stmt1;



END$$

