CREATE DEFINER=`jkc`@`%` PROCEDURE `LoadDiskon` (IN `idGerbang` INT)  BEGIN



	SELECT metoda_bayar_id, diskon, tgl_berlaku_awal, tgl_berlaku_akhir



	FROM tbl_diskon



	WHERE gerbang_id = idGerbang



	AND aktif = 1



	AND tgl_berlaku_awal <=  NOW()



	AND tgl_berlaku_akhir >= NOW()



	;



END$$

CREATE DEFINER=`jkc`@`%` PROCEDURE `LoadJadwal` (IN `idPultol` VARCHAR(7), IN `idKspt` VARCHAR(7))  BEGIN



  SELECT jadwal_id,shift,tanggal,kspt_id,pultol_npp,gardu_id_ke1,gardu_id_ke2,gardu_id_ke3,gardu_id_ke4 FROM tbl_pegawai a



  left join tbl_jadwal_tugas b



  ON b.pultol_npp = a.npp_no 



  where a.npp_no= idPultol 

	and b.kspt_id= idKspt 

	and DATE(b.tanggal)=if ((HOUR(NOW())<6),DATE(DATE_ADD(NOW(), INTERVAL -1 DAY)),DATE(NOW()))

	AND b.shift=IF((HOUR(NOW())<6),3,IF((HOUR(NOW())<14),1,IF((HOUR(NOW())<21),2,3)))



  order by pultol_jam_absensi desc limit 1;



END$$

CREATE DEFINER=`jkc`@`%` PROCEDURE `LoadJadwalNew` (IN `idPultol` VARCHAR(7), IN `idKspt` VARCHAR(7))  BEGIN



  SELECT jadwal_id,shift,tanggal,kspt_id,pultol_npp,gardu_id_ke1,gardu_id_ke2,gardu_id_ke3,gardu_id_ke4 FROM tbl_pegawai a



  left join tbl_jadwal_tugas b



  ON b.pultol_npp = a.npp_no 



