CREATE DEFINER=`jkc`@`%` FUNCTION `GetTanggalTugas` (`_waktuBukaPerioda` DATETIME, `_shift` TINYINT) RETURNS DATE NO SQL
BEGIN



  DECLARE __workDate DATE;



  DECLARE __jam      TINYINT;







  SET __workDate = DATE(_waktuBukaPerioda);







  IF _shift = 3 THEN



    SET __jam = HOUR(_waktuBukaPerioda);



    IF __jam <= 12 THEN



      SET __workDate = SUBDATE(__workDate, INTERVAL 1 DAY);



    END IF;



  END IF;



  RETURN __workDate;











END$$

